import React, { Component } from "react";
import classes from "./hoc/Layout/Layout.module.css";
import { MainPage } from "./containers/main/MainPage";

function App() {
  return (
    <div className={classes.Layout}>
      <main>
        <Route path="/MainPage" exact component={MainPage} />
      </main>
    </div>
  );
}
export default App;
